import React, { Component } from "react"

function App() {
  const tittle = "Blog post"
  const comments = [
    { id: 1, text: "comment one" },
    { id: 2, text: "comment two" },
    { id: 3, text: "comment three" },
    { id: 4, text: "comment four" },
  ]

  return (
    <>
      <h1>number of comments ({comments.length})</h1>
    </>
  )
}

export default App
